import './App.css';
import { BrowserRouter as Router, Route, Switch as Switch } from 'react-router-dom';
import Headers from './components/header/Headers';
import Footer from './components/footer/footer';
import Login from './pages/Login';
import ReactSwitch from 'react-switch';
function App() {
  return (
    <>

        <Switch>
          <Route path='/login'>
            <Login/>
          </Route>
        </Switch>

      <Headers />
    </>
  );
}

export default App;
